// RoomBox.jsx

import React from 'react';

const RoomBox = ({ roomNumber, capacity, slotsLeft }) => {
  return (
    <div className="w-36 h-36  m-5 flex flex-col items-center justify-center ori-hostel-manager ">
      <p className='text-center'>Room No: {roomNumber}</p>
      <p className='text-center'>Capacity: {capacity}</p>
      <p className='text-center'>Slots:  {slotsLeft}</p>
    </div>
  );
};

export default RoomBox;
